import React from 'react';

import { useState, useEffect } from 'react';

import LiftConsoleButton from './lift_console_button';
import Card from 'react-bootstrap/Card';

function submit_request(to_floor, from_floor)
{
    console.log("ERROR");
    fetch('http://localhost:8000/api/lift/request/', {
    method: 'POST',
    headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json',
    },
    body: JSON.stringify({
        from_floor: from_floor,
        to_floor: to_floor,
    })
    });
}

const Fetch = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch('http://127.0.0.1:8000//api/lift/config/')
      .then((res) => {
        console.log(res)
        return res.json();
      })
      .then((data) => {
        let avaliable_floors = [];
        for (let lift of data["lifts"]){
            avaliable_floors = avaliable_floors.concat(lift["serviced_floors"].filter(item2 =>
                !avaliable_floors.some(item1 => item1 === item2)
            ));
        }
        console.log(avaliable_floors);
        setData(avaliable_floors);
      });
  }, []);
  return ( <div>
            <Card style={{ width: '30%' }}>
                <Card.Body>
                    <Card.Title>Lift Console number 1</Card.Title>
                        {data.map((floor) => ( <Button variant="primary" onClick={() => submit_request(this.props.index, this.props.floor)}>{this.props.index}</Button>))}
                </Card.Body>
            </Card>
            <Card style={{ width: '30%' }}>
                <Card.Body>
                    <Card.Title>Lift Console number 2</Card.Title>
                        {data.map((floor) => ( <LiftConsoleButton index={floor} floor={0}/>))}
                </Card.Body>
            </Card>
        </div>
        )
};
export default Fetch;
